import React, { useEffect, useState } from 'react';
import axios from 'axios';

function ListaUsuarios() {
    const [usuarios, setUsuarios] = useState([]);
  
    useEffect(() => {
      // Lógica para obtener los usuarios registrados desde el backend
      obtenerUsuarios();
    }, []);
  
    const obtenerUsuarios = async () => {
      try {
        const response = await axios.get('/api/usuarios'); // Asegúrate de configurar la ruta correcta hacia tu endpoint de usuarios en Django
        setUsuarios(response.data);
      } catch (error) {
        console.error(error);
      }
    };
  
    return (
      <div>
        <h2>Usuarios Registrados</h2>
        <ul>
          {usuarios.map((user) => (
            <li key={user.id}>{user.usuario}</li>
          ))}
        </ul>
      </div>
    );
  }
  
  export default ListaUsuarios;
